import React from "react";
import { Container } from "react-bootstrap";
import About from "./components/About";
import Experience from "./components/Experience";
import Projects from "./components/Projects";

import './App.scss';


function App() {
  return (
    <Container fluid>
      <About />
      <Experience />
      <Projects />
    </Container>
  );
}

export default App;
